    false,nt"url": null,nt"notes": "The Missisquoi National Wildlife Refuge
    has a total of four impounded wetlands. The water levels are manageable to a limited
    degree in three of them: Cranberry Pool, Goose Bay Pool, and Stephen Young Marsh.
    The Big Marsh impoundment does not have a functional water control structure. All
    except the Young Marsh Impoundment are unmanageable when the level of Lake Champlain
    exceeds 98.80 feet in the spring. Objectives and strategies for these impoundments
    are discussed in this report in detail. Planned and actual water levels achieved
    in 2004 will be discussed as well as objectives and strategies for water levels
    in 2005.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
